import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header/Header';
import ProductList from './components/ProductList/ProductList';
import ProductDetails from './components/ProductList/ProductDetails';
import Footer from './components/Footer/Footer';

function App() {
  const [cart, setCart] = useState([]);

  const products = [
    { id: 1, name: 'Apple iPhone 14', price: 79999, imageUrl: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Samsung Galaxy S22', price: 69999, imageUrl: 'https://th.bing.com/th/id/OIP.DYrf1WpQ17dD8TU2cgGWsQHaHa?w=184&h=185&c=7&r=0&o=5&dpr=1.3&pid=1.7' },
    { id: 3, name: 'Sony WH-1000XM4 Headphones', price: 24999, imageUrl: 'https://th.bing.com/th/id/OIP.nlmxOoBLSywEalpOd6sKXwHaHa?w=167&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7' },
    { id: 4, name: 'Mi TV 4A Pro 32 inch HD Ready', price: 15999, imageUrl: 'https://th.bing.com/th/id/OIP.5voS81py6IVLDQFE30D4swHaE8?w=252&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7' },
    { id: 5, name: 'boAt Airdopes 141 True Wireless Earbuds', price: 1499, imageUrl: 'data:image/jpeg;base64,' },
    { id: 6, name: 'Amazon Echo Pop', price: 3499, imageUrl: 'data:image/jpeg;base64,' },
    { id: 7, name: 'Amazon Echo Show 8', price: 10499, imageUrl: 'https://th.bing.com/th/id/OIP.k-PZ_KtE0fLKZYSMlzDbFwHaEK?w=249&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7' },

  ];

  const addToCart = (product) => {
    setCart([...cart, product]);
    alert(`${product.name} added to the cart!`);
  };

  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<ProductList />} />
          <Route 
            path="/product/:productId" 
            element={<ProductDetails products={products} onAddToCart={addToCart} />} 
          />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
